<h1 class="title">20210509</h1>
<p class="author"><a href="index.html">Takala</a></p>
</header>
<p>この春，関東で新たに開業した交通系施設の有名どころと言えば， 山手線の高輪ゲートウェイ駅と横浜のAIR CABINであろう．</p>
<p>機会があったので視察してきた．</p>

<p>AIR CABINからの夜景はとても綺麗なのだが， 撮影しようとすると，ガラスに光が反射してしまって うまくできない．</p>
<p>私の間抜け顔が映り込んでしまうので，アップロードは遠慮しておく．</p>
<p>ロープウェイというと，スキー場のボロボロの機会というイメージが どうしても先行するが，みなとみらいにあると近未来感がある．</p>
